import React from 'react';
import './App.css';
import {useState,useEffect} from 'react';
import {Header,LoginInButton,Signin,AddList,List} from './comportnets/index';
import { BrowserRouter, Link, Switch, Route } from 'react-router-dom';


function App() {
  const [message,setMessage] = useState('');
  useEffect(() =>{
    fetch('/api')
      .then((res) => res.json())
      .then((data) => setMessage(data.message));
  },[])
  return (
    <BrowserRouter>
      <div className='App'>
        <Link to="/">Home</Link>
        <br/>
        <Link to="/Login">LoginPage</Link>
        <br/>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/Login">
            <Signin />
          </Route>
        </Switch>

      </div>
    </BrowserRouter>
  );
}

export default App;
